import { Injectable } from '@angular/core';
import { FormGroup } from '@angular/forms';
import { BehaviorSubject } from 'rxjs';
import { AuthService } from './auth.service';
import { UserService } from './user.service';
import { Blog } from '../Models/blog';

@Injectable({
  providedIn: 'root',
})
export class BlogService {
  constructor(
    private authService: AuthService,
    private userService: UserService
  ) {}
  private createdBlogs: Blog[] = [
    {
      blogId: 1,
      blogImageFileName: 'Image-1.png',
      blogImage:
        'data:image/png;base64,',
      blogTitle: 'The Impact of Technology on the Workplace: How',
      bloggerUserId: 1,
      bloggrUserName: 'jd',
      createdAt: '2024-03-01T13:42:54.168Z',
      description: 'this is the blog details',
      tags: ['Films', 'World politics'],
    },
    {
      blogId: 2,
      blogImageFileName: 'Image-1.png',
      blogImage:
        'data:image/png;base64,',

      blogTitle: 'The Impact of Technology on the Workplace: How',
      bloggerUserId: 2,
      bloggrUserName: 'md',
      createdAt: '2024-02-01T13:42:54.168Z',
      description: 'this the is the blog details',
      tags: ['Poems', 'World politics'],
    },
    {
      blogId: 3,
      blogImageFileName: 'Image-1.png',
      blogImage:
        'data:image/png;base64,',
      blogTitle: 'The Impact of Technology on the Workplace: How',
      bloggerUserId: 1,
      bloggrUserName: 'jd',
      createdAt: '2024-02-01T13:42:54.168Z',
      description: `<h3>Research Your Destination</h3>
<p>Traveling is an enriching experience that opens up new horizons, exposes us to different cultures, and creates memories that last a lifetime. However, traveling can also be stressful and overwhelming, especially if you don't plan and prepare adequately. In this blog article, we'll explore tips and tricks for a memorable journey and how to make the most of your travels.</p>
<p>One of the most rewarding aspects of traveling is immersing yourself in the local culture and customs. This includes trying local cuisine, attending cultural events and festivals, and interacting with locals. Learning a few phrases in the local language can also go a long way in making connections and showing respect.</p><h3>Research Your Destination</h3>
<p>Traveling is an enriching experience that opens up new horizons, exposes us to different cultures, and creates memories that last a lifetime. However, traveling can also be stressful and overwhelming, especially if you don't plan and prepare adequately. In this blog article, we'll explore tips and tricks for a memorable journey and how to make the most of your travels.</p>
<p>One of the most rewarding aspects of traveling is immersing yourself in the local culture and customs. This includes trying local cuisine, attending cultural events and festivals, and interacting with locals. Learning a few phrases in the local language can also go a long way in making connections and showing respect.</p>`,
      tags: ['Poems', 'World politics'],
    },
  ];

  private isBlogFormVisible: boolean = false;

  showBlogFormSubject: BehaviorSubject<boolean> = new BehaviorSubject<boolean>(
    this.isBlogFormVisible
  );

  private blogs: Blog[] = this.getAllBlog();

  blogSubject: BehaviorSubject<Blog[]> = new BehaviorSubject<Blog[]>(
    this.blogs
  );

  addBlog(formGroup: FormGroup, blogImageFileName: string) {
    const { title, tags, blogImage, description } = formGroup.value;
    const blogCreator = this.authService.loggedInUser;

    const newBlog: Blog = {
      blogId: this.getBlogId(),
      blogTitle: title,
      blogImageFileName,
      tags,
      blogImage,
      description,
      bloggrUserName: blogCreator?.userName,
      bloggerUserId: blogCreator?.id,
      createdAt: new Date().toISOString(),
    };

    this.createdBlogs.unshift(newBlog);

    const allBlog = this.getAllBlog();
    this.blogSubject.next(allBlog);
  }

  hideShowBlogForm() {
    this.isBlogFormVisible = !this.isBlogFormVisible;
    console.log(this.isBlogFormVisible);
    this.showBlogFormSubject.next(this.isBlogFormVisible);
  }

  updateBlog(blogId: number, formGroup: FormGroup, blogImageFileName: string) {
    const { title, tags, blogImage, description } = formGroup.value;
    this.createdBlogs = this.createdBlogs.map((blog) => {
      if (blog.blogId === blogId) {
        blog.blogTitle = title;
        blog.blogImage = blogImage;
        blog.blogImageFileName = blogImageFileName;
        blog.description = description;
        blog.tags = tags;
      }
      return blog;
    });

    const allBlog = this.getAllBlog();
    this.blogSubject.next(allBlog);
  }

  private getBlogId() {
    const maxId = this.createdBlogs.reduce(
      (maxId, blog) => Math.max(blog.blogId, maxId),
      0
    );
    return maxId + 1;
  }

  private getAllBlog() {
    return this.createdBlogs?.map((currentBlog) => {
      const desiredUser = this.userService.users?.find((user) => {
        return (
          currentBlog.bloggerUserId === user.id &&
          currentBlog.bloggrUserName === user.userName
        );
      });

      const {
        blogId,
        blogImage,
        blogTitle,
        bloggerUserId,
        description,
        bloggrUserName,
        tags,
        createdAt,
        blogImageFileName,
      } = currentBlog;

      const blog: Blog = {
        blogId,
        blogImage,
        blogImageFileName,
        blogTitle,
        description,
        tags,
        bloggerName: desiredUser?.firstName + ' ' + desiredUser?.lastName,
        bloggerUserId,
        bloggrUserName,
        bloggerImage: desiredUser?.image,
        createdAt,
      };

      return blog;
    });
  }
}
